package inheratance;

public class Parentclass {
	public void Mahesh() {
		System.out.println("Red");
	}
	public void Reddy() {
		System.out.println("Green");
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Parentclass g =new Parentclass();
		g.Mahesh();
		g.Reddy();

	}

}
